import Header from './Header'
const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
}

const withLayout = (Page: any) => {
  const MyComp = () => {
    return (
      <div style={layoutStyle}>
        <Header/>
        <Page/>
      </div>
    )
  }
  MyComp.displayName = 'Layout'
  return MyComp
}

export default withLayout
